		"com/ui5strap/apps/demoapp/i18n/i18n.properties": "#Home\nPAGE_HOME_TITLE=Ui5Strap Demo App\nPAGE_HOME_INTRO=Welcome to the Ui5Strap Demo App. It contains a lot of examples how to use Ui5strap in detail.\n\n#Feed\nPAGE_FEED_TITLE=Action Demo\nPAGE_FEED_PANEL_NEW_TITLE=New Post\nPAGE_FEED_PANEL_POSTS_TITLE=Latest Posts\nPAGE_FEED_LABEL_NAME=Your Name\nPAGE_FEED_LABEL_MESSAGE=Message\nPAGE_FEED_PLACEHOLDER_NAME=Enter your name here ...\nPAGE_FEED_PLACEHOLDER_MESSAGE=Write something ...\nPAGE_FEED_BUTTON_SUBMIT=Submit\nPAGE_FEED_BUTTON_CANCEL=Cancel\n\nPAGE_CONTRDEMO_LIST_TITLE=Controller Demo\n\n#Settings\nPAGE_SETTINGS_TITLE=Settings\n\n#Settings Language\nPAGE_SETTINGS_LANGUAGE_TITLE=Language\nPAGE_SETTINGS_TAB_SET=Set\nPAGE_SETTINGS_TAB_MORE=More\nPAGE5_BUTTON=To Page 2\n\n#Settings Themes\nPAGE_SETTINGS_THEME_TITLE=Themes\nPAGE_SETTINGS_THEME_INTRO=You can switch the theme here. This is just for demonstration purposes and does not switch the theme permanently.\nPAGE_SETTINGS_THEME_BACK_NOTICE=Go to page 3 directly from here.\nPAGE_SETTINGS_THEME_BACK_BUTTON=To Page 3\n\n#Page Bootstrap Controls\nPAGE_CONTROLS_TITLE=Bootstrap Controls\nPAGE_CONTROLS_BUTTONS_TITLE=Buttons\nPAGE_CONTROLS_CONTAINERS_TITLE=Containers\nPAGE_CONTROLS_ICONS_TITLE=Icons\nPAGE_CONTROLS_TYPOGRAPHY_TITLE=Typography\nPAGE_CONTROLS_NAVS_TITLE=Navs\nPAGE_CONTROLS_GRID_SYSTEM_TITLE=Grid\nPAGE_CONTROLS_PROGRESS_TITLE=Progress\nPAGE_CONTROLS_FORM_TITLE=Form\nPAGE_CONTROLS_WHEELS_TITLE=Wheels\nPAGE_CONTROLS_INDICATORS_TITLE=Indicators\nPAGE_CONTROLS_MEDIA_TITLE=Media\nPAGE_CONTROLS_DIALOGS_TITLE=Dialogs\n\nPAGE_CUSCON_SIMPLE_TITLE=Simple\nPAGE_CUSCON_JQUERY_TITLE=JQuery Plugin\n\n#Page Custom Controls\nPAGE_STATISTICS_TITLE=Custom Controls\nPAGE3_HEADING1_TITLE=Awesome!\nPAGE3_HEADING1_TEXT=Lorem ipsum dolor sit amet, [strong]consetetur sadipscing[/strong] elitr, sed diam nonumy eirmod tempor invidunt ut [em]labore et dolore[/em] magna aliquyam erat, sed diam voluptua.\n\nTEST=Well lets test if [strong]text outline[/strong] still works ({0}) if setter is called.",
		"com/ui5strap/apps/demoapp/i18n/i18n_de.properties": "#Home\nPAGE_HOME_TITLE=Demo\nPAGE_HOME_INTRO=Willkommen in der Ui5Strap Demo App. Sie koennen sie als Template fuer Ihre Apps verwenden.\n\n#Feed\nPAGE_FEED_TITLE=Feed\nPAGE_FEED_PANEL_NEW_TITLE=Neuer Eintrag\nPAGE_FEED_PANEL_TITLE=Neue Posts\nPAGE_FEED_LABEL_NAME=Ihr Name\nPAGE_FEED_LABEL_MESSAGE=Nachricht\nPAGE_FEED_PLACEHOLDER_NAME=Geben Sie hier Ihren Namen ein ...\nPAGE_FEED_PLACEHOLDER_MESSAGE=Schreiben Sie etwas ...\nPAGE_FEED_BUTTON_SUBMIT=Absenden\nPAGE_FEED_BUTTON_CANCEL=Abbrechen\n\n#Statistics\nPAGE_STATISTICS_TITLE=Statistiken\nPAGE3_HEADING1_TITLE=Super!\n\n#Settings\nPAGE_SETTINGS_TITLE=Einstellungen\n\n#Settings Language\nPAGE_SETTINGS_LANGUAGE_TITLE=Sprache\nPAGE5_BUTTON=To Page 2\n\nPAGE_SETTINGS_TAB_SET=Setzen\nPAGE_SETTINGS_TEXT_SET=Sie koennen die Sprache hier wechseln. Bitte beachten Sie, dass dies nur zu [strong]Demonstrationszwecken[/strong] dient und die Sprache nicht dauerhaft veraendert.\n\nPAGE_SETTINGS_TAB_MORE=Mehr\n\n#Settings Themes\nPAGE_SETTINGS_THEME_TITLE=Themes\nPAGE_SETTINGS_THEME_INTRO=Sie koennen das Theme hier wechseln. Bitte beachten Sie, dass dies nur zu Demonstrationszwecken dient und das Theme nicht dauerhaft veraendert.\nPAGE_SETTINGS_THEME_BACK_NOTICE=Gehen Sie direkt zu den Statistiken von hier.\nPAGE_SETTINGS_THEME_BACK_BUTTON=Zu den Statistiken",
